export function CartItem({ date,CountUp}) {

    return <div className="col-md-6">
        <div className="row">
            <div className="col-md-6">
                <div className="row">
                  
                </div>
                {
                        date.map(elm => {
                            return <CartItem
                                key={elm.id}{...elm}
                                CountUp={onMove}
                            />

                        })
                    }
            </div>

        </div>
    </div>
}
